'''Veos''' is a portmaster and treasure hunter, located directly south of the [[Rusty Anchor Inn]] in [[Port Sarim]]. He disappears after the quest [[A Kingdom Divided]] and is replaced by [[Cabin Boy Herbert]]. He will take players to [[Port Piscarilius]] and [[Land's End]] in [[Great Kourend]], a large kingdom west of the mainland. From Port Piscarilius, he will offer travel to Land's End and Port Sarim.

==Quests==
Veos is involved in several quests, one of which he plays a minor role in.

===X Marks the Spot===
During [[X Marks the Spot]], players help him out in searching for treasure, which is an [[ancient casket]].

===Client of Kourend===
During the [[Client of Kourend]] quest, he requests the player to help his client in gathering knowledge on the five cities of Great Kourend. Towards the end of the quest, it is discovered Veos was unaware of the interactions they had during this time, and was actually possessed by his [[Veos' Client|client]] the whole time.

===Side quest===
After Client of Kourend, using [[wolf bones]] on Veos will trigger a side quest in which you can retrieve [[Copper's crimson collar]] for him.

===Dragon Slayer II===
During [[Dragon Slayer II]], Veos plays a minor role by suggesting that players visit the [[Library Historical Archive]] for information about [[Camorra]], as he does not know who she is.

==Pre-release==
He was released silently along with the [[Grand Exchange]], located in a jetty south of [[Port Tyras]] and north-west of [[Zul-Andra]]. If players asked about his origins, he would refuse to answer, but would whisper to the player that "we are not alone". During the [[2015 Christmas event]] he was relocated to Port Sarim, but did not allow players to board his ship, as it was unable to set sail just yet due to it requiring repairs.

